import React from 'react';

class ChildMatchComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            match: props.match
        };
    }

    render() {
        return (<h1> {this.state.match.robot.teamNumber}s {this.state.match.matchNumber} match </h1>);
    }
}

export default ChildMatchComponent;
